INSERT INTO `autor` VALUES (1,'Aleksandar','Puškin','Aleksandar Sergejevič Puškin, od oca Sergeja i majke Nadežde, rođen je 26. maja 1799. S očeve strane vukao je poreklo od ruskih plemića, a s majčine je bio u srodstvu s jednim afričkim kraljem. ',NULL),(2,'Uroš','Petrović','Uroš Petrović piše knjige za decu i mlade koje pomeraju granice u savremenoj srpskoj literaturi. Počev od zbirki priča – mozgalica i romana u zagonetkama do fantastičnih pripovesti, dela ovog autora jesu originalne pustolovine koje nagrađuju čitaoce.',NULL),(3,'Vanja','Bulić','Vanja Bulić (1947) radni vek je proveo kao novinar u pisanim i elektronskim medijima. Za televiziju je snimio više od dve i po hiljade jednočasovnih emisija, a pisao je za gotovo sve prestižne listove nekadašnje Jugoslavije.',NULL),(4,'Džejms','Paterson','Džejms Paterson je rođen 1947. godine. Devedesetih godina bio je predsednik upravnog odbora reklamne kompanije J. Walter Thompson. Ubrzo posle uspeha sa knjigom Prikrade se pauk povukao se iz firme i posvetio pisanju.','www.jamespatterson.com'),(5,'Mišel','Obama','Mišel Obama je američka pravnica i autorka koja je bila prva dama Sjedinjenih Država od 2009. do 2017. U braku je sa 44. predsednikom Sjedinjenih Država Barakom Obamom.',NULL),(6,'Rik','Riordan','Rik Riordan, autor serije knjiga za decu „Persi Džekson i bogovi Olimpa“ jedan je od plodnijih i uspešnijih američkih pisaca novije generacije, koji se potvrdio mnogobrojnim nagradama za svoje delo kao i čelnim pozicijama na bestseler listama.','www.rickriordan.com'),(7,'Nenad Novak','Stefanović','Nenad Novak Stefanović rođen je u Beogradu 1961. godine.',NULL),(8,'Džordž R. R.','Martin','Džordž Martin je rođen 1948. u Nju Džerziju kao Džordž Rejmond Ričard Martin. Sklonost ka pisanju razvio je još kao dete, pišući priče o čudovištima i prodajući ih komšijskoj deci.','https://georgerrmartin.com'),(9,'Agata','Kristi','Agata Kristi je najobjavljivanija autorka svih vremena. Jedino Biblija i Šekspir premašuju ukupni tiraž njenih dela – prodato ih je milijardu na engleskom jeziku i još milijardu u prevodu na stotinu drugih jezika',NULL),(10,'Sara Dž. ','Mas','Sara Dž. Mas je autorka tinejdž serijala koji su bestseleri broj 1 na listi Njujork tajmsa. ',NULL);
